import Hello from "./Hello";

const Main = () => {
  return (
    <main>
      <Hello name="Ahmad Fauzan" />
      <Hello name="Akbar Mubarak" />
      <Hello name="Michael Jonas" />
      <Hello name="Arisandi Aris" />
      <Hello name="Dzulqarnain" />
    </main>
  );
};

export default Main;
